(109, 'LUCKHARDT RESIDENCE', '3899 CREEKSIDE WAY, OAKLEY, CA 94561', NULL, 'yes', '2200', 'Residential', '70', '2', '<p>estimate on LABOR ONLY for Windows Installation (whole house), drywall/insulation inside living space (whole house), and finally siding/insulation (whole house). This home caught on fire and has been gutted, only frame inside whole house. The client will purchase all materials (which you can do take off if need be) and he just needs someone to do the labor.</p>', '<p>Drywall, Openings, Siding, Insulation</p>', NULL, 'https://drive.google.com/drive/folders/1HnbrjQuIv1faYq2LUO-AulwUarQXP1TA?usp=share_link', 'https://drive.google.com/drive/folders/155aBXiGje3kQNmRm9IupWiyPZV2qNr1w?usp=share_link', '2023-05-19 21:30:00', 'excel,QA', '<p>The plans call out a window schedule on page 6 I believe but I didn\'t see the sliding door. Just so that I know materials, would it be a problem calling out the sheets of sheetrock and how much insulation would be needed just to make sure that we are on Par with the client as well as calling out the T1-11 siding sheets as well</p><p>We are going to give them a labor only bid, but would like to know the materials aspect for ourselves.</p><p>I will need to have material take-off &amp; labor for the following trades; Drywall Installation w/tape, mud &amp; texture, the insulation inside the whole house (except garage); windows/sliding door around the whole house, (window schedule within the plans,) will need the labor and materials to install the windows (i.e bituthane, caulking) and lastly T1-11 siding material &amp; labor for whole house exterior with the trim &amp; whole house wrap material and labor under the siding.</p><p><strong>(REV-1)</strong></p><blockquote><p><strong>Hello, The estimate format looks great, but it is missing the insulation labor hours to install, the house wrap paper installation that goes under the siding. Per your message, I did forget to add the demo of the existing siding, and would you be able to add that in?</strong><br><br><strong>Thank you,</strong></p></blockquote>', '<ol><li>I have taken note that the installation cost for insulation and house wrap has already been incorporated into the estimate, and it has been visually highlighted in yellow to indicate its inclusion.&nbsp;</li><li>The estimated labor hours for insulation installation is <strong>43 hours</strong>, while the estimated labor hours for house wrap installation is <strong>7.5 hours</strong></li><li>The demolition for the existing siding has been added as per your request</li></ol>', NULL, NULL, NULL, 'deliver', 'none', '2023-05-17 20:33:01', '2023-05-19 18:14:49'),
