(150, 'Hotel Renovation', NULL, NULL, 'yes', NULL, 'Commercial', NULL, '306', '<p>The PIP documents shows every trade needed.</p><p>\"Markups should be clear\"</p><p>&nbsp;</p>', NULL, '2.2', 'https://drive.google.com/drive/folders/1eNdPIEi2pnDpdaTuIQOBry-Xwa0tObP9?usp=share_link', 'https://drive.google.com/drive/folders/1sUqmMmN4gpg2vZu1glipY2dod6AZXwkZ?usp=drive_link', '2023-05-29 23:55:00', NULL, '<p>I believe the hotel has their own source for these fixture items so I will not need</p><p>&nbsp;a price for these:&nbsp;</p><p>-Casegoods&nbsp;</p><p>-Bath tubs/showers/faucets/shower rods/curtains/shower doors/surrounds and pans&nbsp;</p><p>-safes&nbsp;</p><p>-decorative bedding and mattresses</p><p>&nbsp;-bed frames -refrigerators&nbsp;</p><p>-microwaves&nbsp;</p><p>-vanity bases and tops&nbsp;</p><p>-soft seating&nbsp;</p><p>-lighting&nbsp;</p><p>-window treatments&nbsp;</p><p>-art and mirrors&nbsp;</p><p>-carpet and flooring&nbsp;</p><p>-wall vinyl and corner guards&nbsp;</p><p>-slat wall system at market&nbsp;</p><p>-decorative planters&nbsp;</p><p>-back wall signage at entry&nbsp;</p><p>-fitness equipment</p><p>&nbsp;-felt panels and column wraps in lobby area&nbsp;</p><p>-graphic wall coverings -pool furniture</p>', NULL, NULL, NULL, NULL, 'deliver', 'none', '2023-05-25 22:57:34', '2023-05-30 23:22:04'),
