(154, 'BLDG A - BROOKESIDE T.I', '114TH & SLIDE DEVELOPMENT, LUBBOCK', NULL, 'yes', NULL, 'Commercial', '24', '1', '<p>Notes from GC:</p><p>&nbsp;</p><p>Please note that they only want us to tape, bed, texture, paint.</p><ul><li>Walls</li><li>6 Wood doors &amp; wood door frames</li><li>Interior of 1 hollow metal door</li><li>Wood base to be painted</li><li>Exposed open ceiling + exposed pipes, duct, etc to be painted white</li><li>Millwork – ignore the millwork elevations in the plans, the only paint I’d need will be about 7 linear feet of lower cabinets in the office (the rest will be plam)</li></ul>', NULL, 'Client Template', 'https://drive.google.com/drive/folders/1D6oNs8Y3SYULxAsHRsPFcj0YvJWDQP4R?usp=share_link', 'https://drive.google.com/drive/folders/1cl7ESds8gvi9y232geCuEhuCsJYCjQ7l?usp=drive_link', '2023-05-30 22:11:00', NULL, '<p>This is for a customer that I have been trying to land for a LONG time.&nbsp; They\'re throwing us this small job as a test.&nbsp; We need to be very competitive on this quote but if we\'re too low we will look incompetent.&nbsp; We need to be accurate as always.&nbsp;</p><p>&nbsp;</p><p>Our TBT rate for labor is around $15 a sheet.&nbsp; Our paint labor cost is around $2 a sqft</p><p>&nbsp;</p><p>We will have to prime everything first especially the exposed ceiling. The ceiling will take a more expensive primer.&nbsp;</p><p>&nbsp;</p>', NULL, NULL, NULL, NULL, 'deliver', 'none', '2023-05-29 21:11:35', '2023-05-30 21:57:02'),
